import "./App.css";

function App() {
  const api = {
    key: "471256361e4220ec0a8e0e99282e5458",
    base: "api.openweathermap.org/data/2.5/",
  };

  let query = "punjab";

  const search = async () => {
    let response = fetch(`${api.base}weather?q=${query}&appid=${api.key}`);
    response = response.json();
    console.log("response", response);
  };

  return (
    <div className="app">
      <main>
        <div className="search-box">
          <input
            type="text"
            placeholder="search..."
            className="search-bar"
            onKeyPress={search}
          />
        </div>
        <div className="location-box">
          <div className="location"> Delhi</div>
          <div className="date">Monday 11 october 2021</div>
        </div>
        <div className="weather-box">
          <div className="temp">30c</div>
          <div className="weather">Sunny</div>
        </div>
      </main>
    </div>
  );
}

export default App;
